import React from 'react'

function Navbar() {
  return (
    <nav>
      <img src="/assets/logo.svg" alt="logo" srcset="" />
      <button className="btn slide-show__btn uppercase lt-spacing-2">
        START SLIDESHOW
      </button>
    </nav>
  );
}

export default Navbar
